//SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

interface DUSD{
    function transfer(address to, uint tokens) external returns (bool success);
    function transferViaContract(address from, address to, uint tokens) external returns (bool success);
}
contract Invest
    {

        address payable public owner;
        uint public ownerfees;
        //address DUSDcontract=0x7EF2e0048f5bAeDe046f6BF797943daF4ED8CB47;
        //address MUSDcontract=0xA9629d51ceC0720DE5F52Fd4Af80Deb844FF93cA;
        address customToken;
        uint public totalCUSTOMInvestors;
        uint public totalDUSDInvestors;
        uint public totalMUSDInvestors;



        struct allInvestments{
            uint investedAmount;
            uint withdrawnTime;
            uint investmentNum;

        }

        struct Data{

            mapping(uint=>allInvestments) investment;
            address[] hisReferrals;
            address referralFrom;
            uint reward;
            uint noOfInvestment;
            uint totalInvestment;
            bool investBefore;
        }

        mapping(address=>Data) public DUSDinvestor;

        constructor(){

            owner=payable(msg.sender);              //here we are setting the owner of this contract
            ownerfees=0.003 ether;                  // setting the fees of owner
        }

        function sendRewardToDUSDReferrals(address investor,uint _investedAmount) internal  //this is the freferral function to transfer the reawards to referrals
        { 

            address temp = investor;       
            uint[] memory percentage = new uint[](4);
            percentage[0] = 5 ether;
            percentage[1] = 5 ether;
            percentage[2] = 5 ether;
            percentage[3] = 5 ether;


            uint lastReferal = 0.5 ether;

            // for(uint i=0;i<20;i++)
            // {

            //     if(DUSDinvestor[temp].referralFrom!=address(0))
            //     {
            //         temp=DUSDinvestor[temp].referralFrom;
            //         DUSDinvestor[temp].reward += ((percentage * _investedAmount)/100);
            //         percentage--;
            //     } 
            //     else
            //     {
            //         break;
            //     }
            // }

        }


        //this function is used to invest the DUSD TOken in tihis business



        function InvestDUSD(uint _investedamount,uint _investmentPeriod,address _referral,address DUSDcontract) external payable returns(bool success){
            require(_investedamount > 0,"value is not greater than 0");     //ensuring that investment amount is not less than zero
            require(msg.value==ownerfees,"fees is not enough");            //ensurinng that sending fees is equal to the owner fees

                                                                            // in the below lines of code i am saving the investor details in smart contract for furthur investments and referrals and reards

            if(DUSDinvestor[msg.sender].investBefore == false)
            { 
                totalDUSDInvestors++;                                     
            }

            uint num = DUSDinvestor[msg.sender].noOfInvestment;
            DUSDinvestor[msg.sender].investment[num].investedAmount =_investedamount;
            DUSDinvestor[msg.sender].investment[num].withdrawnTime=block.timestamp + (_investmentPeriod * 1 days);
            DUSDinvestor[msg.sender].investment[num].investmentNum=num;
            DUSDinvestor[msg.sender].totalInvestment+=_investedamount;
            DUSDinvestor[msg.sender].investBefore=true;
            DUSDinvestor[msg.sender].noOfInvestment++;
            DUSD(DUSDcontract).transferViaContract(msg.sender,address(this),_investedamount);
            if(_referral==address(0))                                         //checking that investor comes from the referral link or not
            {
                DUSDinvestor[msg.sender].referralFrom = address(0);
            }
            else
            {
                DUSDinvestor[msg.sender].referralFrom = _referral;
                if(DUSDinvestor[_referral].totalInvestment > 0 || DUSDinvestor[_referral].reward > 0)
                {
                    DUSDinvestor[_referral].hisReferrals.push(msg.sender);
                    sendRewardToDUSDReferrals(msg.sender,_investedamount);      //with this function, sending the reward to the all 12 parent referrals
                }
            }
            owner.transfer(msg.value);                                           //sending the fees(0.003 bnb) to the owner
            return true;

        }


        function withdrawDUSDReward(address DUSDcontract) external payable returns (bool success){

            require(msg.value==ownerfees,"fees is not enough");                                      //ensurinng that sending fees is equal to the owner fees
            require(DUSDinvestor[msg.sender].reward>0,"you dont have rewards to withdrawn");         //ensuring that if the investor have rewards to withdraw
            require(DUSDinvestor[msg.sender].hisReferrals.length>=5,"you should have minimum 5 referrals then you can withdraw reward");    ////checking that if investor has got minimum 5 referrals in the business so then he can withdraw his reward
            //require(block.timestamp>DUSDinvestor[msg.sender].withdrawnTime,"this is not your reward withdrawn time");

            uint amount=DUSDinvestor[msg.sender].reward;    
            DUSD(DUSDcontract).transfer(msg.sender,amount);             // transfering the reward to investor             
            DUSDinvestor[msg.sender].reward=0;                          // setting his reward 0
            owner.transfer(msg.value);                                  // sending the withdraw fees(0.003 bnb) to owner
            return true;

        }


        function withdrawDUSDInvestment(uint _id,address DUSDcontract) external payable returns (bool success){

            require(msg.value==ownerfees,"fees is not enough");                                                                     //ensurinng that sending fees is equal to the owner fees
            require(DUSDinvestor[msg.sender].investment[_id].withdrawnTime<block.timestamp,"this is not your withdrawn time");      //checking that this specific investment time period is completed or not
            require(DUSDinvestor[msg.sender].investment[_id].investedAmount>0,"you dont have investment to withdrawn");             //checking that he invested any amount or not
            //require(DUSDinvestor[msg.sender].hisReferrals.length>=5,"you should have minimum 5 referrals then you can withdraw your investment");


            uint amount=DUSDinvestor[msg.sender].investment[_id].investedAmount;

            DUSD(DUSDcontract).transfer(msg.sender,amount);             //transferring this specific investment to the investor
            DUSDinvestor[msg.sender].investment[_id].investedAmount=0;  // seting investor's investmet equal to zero                                                                             
            DUSDinvestor[msg.sender].totalInvestment-=amount;           // decrease this invested amount from the total investment
            owner.transfer(msg.value);                                  // transferring fee to owner
            return true;

        }

        function getTotalInvestmentDUSD() public view returns(uint) {   //this function is to get the total investment of the ivestor

            return DUSDinvestor[msg.sender].totalInvestment;

        }

        function getAllDUSDinvestments() public view returns (allInvestments[] memory) { //this function will return the all investments of the investor and withware date
            uint num = DUSDinvestor[msg.sender].noOfInvestment;
            uint temp;
            uint currentIndex;

            for(uint i=0;i<num;i++)
            {
               if( DUSDinvestor[msg.sender].investment[i].investedAmount > 0 ){
                   temp++;
               }

            }

            allInvestments[] memory Invested =  new allInvestments[](temp) ;

            for(uint i=0;i<num;i++)
            {
               if( DUSDinvestor[msg.sender].investment[i].investedAmount > 0 ){
                 //allInvestments storage currentitem=DUSDinvestor[msg.sender].investment[i];
                   Invested[currentIndex]=DUSDinvestor[msg.sender].investment[i];
                   currentIndex++;
               }

            }
            return Invested;

        }

        function getDUSDRewardBalance() view public returns(uint){ //this function is get the total reward balance of the investor
            return DUSDinvestor[msg.sender].reward;
        }

        function DUSDTotalReferrals() public view returns(uint){ // this function is to get the total number of referrals 
            return (DUSDinvestor[msg.sender].hisReferrals).length;
        }

        function DUSDReferralsList() public view returns(address[] memory){ //this function is to get the all investors list with there account number
           return DUSDinvestor[msg.sender].hisReferrals;
        }


    }

